  const FindPassword = () => {
    return <div></div>;
  };

  return (
    <div className="find_account_box">
      <div className="account_nm_box">
        <div className="account_nm_txt"></div>
        <div className="account_nm_input"></div>
      </div>
      <div className="account_email_box">
        <div className="account_email_txt"></div>
